import { connect } from "react-redux";
import './Main.scss'
import p from '../../img/logo_orange&7376c0&white.png'
const About = (props) => {

  return (<>
    <center><img src={p} id="logo-about" /></center>
    <div id="txt-about">
      <h1>How It Works?</h1>
      <br />
      
      <p><b>What? </b>Chinese Auction: A raffle that allows you to buy tickets for the prizes you are interested in from the catalog.</p>
      <br />
      <b>Why?</b>  <p>The money with which you purchase tickets for auction (s) you would like to continue their operations and reach new destinations.</p>
      <br />
      <b>How?</b> <p>Choose here on the site the sale (s) you would like to participate in, buy tickets for the prizes you would like to win (depending on the packages, if any), fill in the credit card details and you are in!</p>
      <br /><h4>Want to get started? <a href="">Click here!</a></h4>
    </div>
    <h1>
      كيف يعمل هذا؟
      ماذا؟ المزاد الصيني: يانصيب يسمح لك بشراء تذاكر الجوائز التي تهتم بها من الكتالوج.
      لماذا ا؟ تسمح الأموال التي تشتري بها تذاكر المزاد الصيني للمزاد العلني بمواصلة عملياتهم والوصول إلى وجهات جديدة.
      كيف؟ اختر هنا في الموقع المزاد (المزادات) الذي ترغب في المشاركة فيه ، واشتر تذاكر الجوائز التي ترغب في الفوز بها (اعتمادًا على الباقات ، إن وجدت) ، واملأ تفاصيل بطاقة الائتمان وأنت في!
      هل تريد أن تبدأ؟ انقر هنا!
    </h1>
  </>);
}

const mapStateToProps = (state) => {
  return {

  };
}
export default connect(mapStateToProps, {})(About);
